import React, { useState } from 'react'
import { Button, CircularProgress, Grid2, IconButton, TextField } from '@mui/material';
import { Formik, Form, Field, useFormik } from 'formik';
import AddPhotoAlternateIcon from '@mui/icons-material/AddPhotoAlternate';
import CloseIcon from '@mui/icons-material/Close';
import { createRestaurant } from '../../State/Customers/Restaurant/actions';
import { useDispatch } from 'react-redux';

const initialValues = {
    name: "", 
    description: "", 
    streetAddress: "", 
    city: "", 
    stateProvince: "", 
    postalCode: "",
    country: "",
    email: "",
    mobile: "",
    twitter: "",
    instagram: "",
    openingHours: "Mon-Sun: 9:00 AM - 9:00 PM",
    images: [],
}


function CreateRestaurantForm() {
    const dispatch = useDispatch();
    const token = localStorage.getItem("jwt");
    const [uploadImage, setUploadingImage] = useState(false);

    function handleFormSubmit(values) {
        const data = {
            name: values.name,
            description: values.description,
            cuisineType: values.cuisineType,
            address: {
                streetAddress: values.streetAddress,
                city: values.city,
                stateProvince: values.stateProvince,
                postalCode: values.postalCode,
                country: values.country
            },
            contactInformation: {
                email: values.email,
                mobile: values.mobile,
                twitter: values.twitter,
                instagram: values.instagram,
            },
            openingHours: values.openingHours,
            images: values.image,
        };
        dispatchEvent(createRestaurant({ data, token }));
        console.log(data);
    }



    function handleImageChange(event) {
        return async function () {
            const file = event.target.files[0];
            setUploadingImage(true);
            // const image = await uploadToCloudinary(file);
            console.log(file);
            setUploadingImage(false);
        }
    }

    function handleRemoveImage(index) {
        const updatedImages = [...formik.values.images];
        updatedImages.splice(index, 1);
        formik.setFieldValue("images", updatedImages);
    }

  return (
    <div className="py-10 px-5 gap-7 lg:flex flex-col items-center justify-start min-h-screen">
      <div className="lg:max-w-4xl ">
              <h1 className=' font-bold text-2xl text-center py-2'>
                  Add New Restaurant
              </h1>
          </div>
          <Formik initialValues onSubmit={handleFormSubmit} className='space-y-4'>
            {formik => (
                  <Form className='flex flex-col space-y-4' >
                     <Grid2 container spacing={2}>
                    <Grid2 className="flex gap-5" item xs={12}>
                    <input
                        type="file"
                        accept="image/*"
                        id="fileInput"
                        style={{ display: "none" }}
                        onChange={(event)=>handleImageChange(event, formik)}
                    />
                    <label className="relative" htmlFor="fileInput">
                        <span className="w-24 h-24 cursor-pointer flex items-center justify-center p-3 border rounded-md border-gray-600">
                        <AddPhotoAlternateIcon
                            className="text-white"
                        />
                        </span>
                        {uploadImage && <div className="absolute left-0 right-0 top-0 bottom-0 w-24 h-24 flex justify-center items-center">
                        <CircularProgress />
                        </div>}
                    </label>

                    <div className="flex flex-wrap gap-2">
                        {formik.values.images.map((image, index) => (
                        <div className="relative">
                            <img
                            className="w-24 h-24 object-cover"
                            key={index}
                            src={image}
                            alt={`ProductImage ${index + 1}`}
                            />
                            <IconButton
                            onClick={() => handleRemoveImage(index)}
                            size="small"
                            sx={{
                                position: "absolute",
                                top: 0,
                                right: 0,
                                outline: "none",
                            }}
                            >
                            <CloseIcon sx={{ fontSize: "1rem" }} />
                            </IconButton>
                        </div>
                        ))}
                    </div>
                    </Grid2>

                    <Grid2 item xs={12} >
                    <TextField
                        fullWidth
                        id="name"
                        name="name"
                        label="Name"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.name}
                    />
                    </Grid2>
                    <Grid2 item xs={12}>
                    <TextField
                        fullWidth
                        id="description"
                        name="description"
                        label="Description"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.description}
                    />
                    </Grid2>
                    <Grid2 item xs={6}>
                    <TextField
                        fullWidth
                        id="cuisineType"
                        name="cuisineType"
                        label="Cuisine Type"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.cuisineType}
                    />
                    </Grid2>
                    <Grid2 item xs={6}>
                    <TextField
                        fullWidth
                        id="openingHours"
                        name="openingHours"
                        label="Opening Hours"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.openingHours}
                    />
                    </Grid2>
                    <Grid2 item xs={12}>
                    <TextField
                        fullWidth
                        id="streetAddress"
                        name="streetAddress"
                        label="Street Address"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.streetAddress}
                    />
                    </Grid2>
                    <Grid2 item xs={4}>
                    <TextField
                        fullWidth
                        id="city"
                        name="city"
                        label="City"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.city}
                    />
                    </Grid2>
                    <Grid2 item xs={4}>
                    <TextField
                        fullWidth
                        id="stateProvince"
                        name="stateProvince"
                        label="State/Province"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.stateProvince}
                    />
                    </Grid2>
                    <Grid2 item xs={4}>
                    <TextField
                        fullWidth
                        id="postalCode"
                        name="postalCode"
                        label="Postal Code"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.postalCode}
                    />
                    </Grid2>
                    <Grid2 item xs={12}>
                    <TextField
                        fullWidth
                        id="country"
                        name="country"
                        label="Country"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.country}
                    />
                    </Grid2>
                    <Grid2 item xs={6}>
                    <TextField
                        fullWidth
                        id="email"
                        name="email"
                        label="Email"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.email}
                    />
                    </Grid2>
                    <Grid2 item xs={6}>
                    <TextField
                        fullWidth
                        id="mobile"
                        name="mobile"
                        label="Mobile"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.mobile}
                    />
                    </Grid2>
                    <Grid2 item xs={6}>
                    <TextField
                        fullWidth
                        id="twitter"
                        name="twitter"
                        label="Twitter"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.twitter}
                    />
                    </Grid2>
                    <Grid2 item xs={6}>
                    <TextField
                        fullWidth
                        id="instagram"
                        name="instagram"
                        label="Instagram"
                        variant="outlined"
                        onChange={formik.handleChange}
                        value={formik.values.instagram}
                    />
                    </Grid2>

                </Grid2>
                      <Button variant='contained' color='primary' type='submit'>
                          Create Restaurant
                      </Button>
              </Form>
                        )}

          </Formik>
    </div>
  )
}

export default CreateRestaurantForm;
